import React, { Component } from "react";

class Sidebar extends Component {
    constructor(props) {
        super(props);
        console.log(props)
    }

    render() {
        // depending on the state we either generate
        // useful message to the user or show the list
        this.first_object = (<div key={this.props.events[0].database_id}>
            <h1>{this.props.events[0].title}</h1>
            <h2>{this.props.events[0].date}</h2>
        </div>);
        this.list = this.props.events.map(event => (
            <div key={event.database_id}>
              <h2>{event.title}</h2>
              <h3>{event.date}</h3>
            </div>
          ));
        return (
            <div className="events">
                <h1>Upcoming event:</h1>
                {this.list}
            </div>
        );
    }
}

export default Sidebar;
